import React from 'react';
import ReactDOM from 'react-dom'


function Conser () {
  let [number, setNumber] = React.useState(0)
  return(
    <>
    <p>{number}</p>
    <button onClick={()=>setNumber(number+1)}>+</button>
    </>

  )
}

ReactDOM.render(<Conser />, document.getElementById('root'))
